ezolana.\n\n&nbsp;\n\n<strong>                                                     Misión</strong>\n\n<strong> </strong>\n\nEvolucionar a un medio audiovisual especializado en la difusión de productos con alta calidad de contenidos orientados a un público interesado en el conocimiento de la historia, y otros aspectos de la cultura.','Quiénes Somos','','inherit','closed','closed','','1088-autosave-v1','','','2018-08-10 20:04:17','2018-08-10 20:04:17','',1088,'http://kwinanatech.dyndns.org/macpecri/2018/08/10/1088-autosave-v1/',0,'revision','',0),(1093,1,'2018-08-10 20:39:01','2018-08-10 20:39:01','','Quiénes Somos','','inherit','closed','closed','','1088-revision-v1','','','2018-08-10 20:39:01','2018-08-10 20:39:01','',1088,'http://kwinanatech.dyndns.org/macpecri/2018/08/10/1088-revision-v1/',0,'revision','',0),(1180,1,'2018-09-25 14:42:48','2018-09-25 14:42:48','<p style=\"text-align: justify;\"></p>\r\n&nbsp;','Jungla Caribe','','inherit','closed','closed','','1095-revision-v1','','','2018-09-25 14:42:48','2018-09-25 14:42:48','',1095,'http://kwinanatech.dyndns.org/macpecri/1095-revision-v1/',0,'revision','',0),(1152,1,'2018-09-25 13:27:28','2018-09-25 13:27:28','','1','','inherit','open','closed','','1-5','','','2018-09-25 13:27:28','2018-09-25 13:27:28','',0,'http://kwinanatech.dyndns.org/macpecri/wp-content/uploads/2018/09/1-4.jpg',0,'attachment','image/jpeg',0),(1096,1,'2018-08-14 14:10:18','2018-08-14 14:10:18','<p style=\"text-align: justify;\">Cuento infantil cuyo propósito es familiarizar al niño con especies animales autóctonas de la jungla del Caribe, muchas de ellas en peligro de extinción. De esta forma, al tiempo que entretenemos, inculcamos en los niños valores conservacionistas.</p>\r\n&nbsp;','Jungla Caribe','','inherit','closed','closed','','1095-revision-v1','','','2018-08-14 14:10:18','2018-08-14 14:10:18','',1095,'http://kwinanatech.dyndns.org/macpecri/2018/08/14/1095-revision-v1/',0,'revision','',0),(1097,1,'2018-08-14 14:10:47','2018-08-14 14: